import React, { useEffect } from 'react';
import axios from 'axios';

export default class PersonList extends React.Component {
    state = {
      persons: []
    }

    componentDidMount() {
      axios.get(`https://localhost:8080/api/v1/routes`)
        .then(res => {
          const persons = res.data;
          this.setState({ persons });
        })
    }

    render() {
      return (
        <ul>
          {
            this.state.persons
              .map(person =>
                <li key={person.id}>{person.start_point}</li>
              )
          }
        </ul>
      )
    }
  }
